House Hunters are pleased to offer for sale exclusively this stunning family home in Al Reem. 




 * Prime location backing onto park;

 * Upgraded and bright kitchen;

 * Upgraded bathrooms;

 * Matured landscaped garden

Located in Al Reem 1, this unique upgraded property has been lovingly cared for by its current owners and offers style and comfort. Accommodation comprises of entrance hallway leading to a spacious living and dining area with upgraded modern kitchen. Patio doors lead to a beautiful a landscaped garden with exit gate leading to Swimming pool and children&#39;s play area which is just 50 meters away. A Guest powder room, study room and Maids room completes the ground floor accommodationUpstairs there is a large master bedroom with upgraded vanity and large walk-in closet and balcony over looking the garden and park. A family bathroom and two spacious bedrooms each with fitted wardrobes completes the accommodation .
 A must view property, call me today!


